import React from 'react';
import NavigationTab from './src/navigation/NavigationTab'
import { NavigationContainer } from '@react-navigation/native';


export default function App() {
  return (
    <NavigationContainer>
      <NavigationTab />
    </NavigationContainer>
  )
}
